CREATE PROCEDURE [dbo].[tbl_Election_Proc]
@Type VARCHAR(50),
@Search VARCHAR(max) = null,
@ID int = null,
@Title varchar(max) = null,
@ElectionDate datetime = null,
@Remarks varchar(max) = null,
@Active bit = null,
@Timestamp datetime = null,
@User INT = NULL,
@Candidates tp_Candidate READONLY,
@Vote tp_Vote READONLY
AS
BEGIN
IF @Type = 'Create'
BEGIN
	INSERT INTO [tbl_Election]
	([Title],[ElectionDate],[Remarks], Active)
	VALUES
	(@Title,@ElectionDate,@Remarks, 1)

	INSERT INTO tbl_Candidate (UniqueID,ElectionID
      ,[UserID]
      ,[Position]
      ,[Plataforma]
      ,[Active])
	  SELECT NEWID(),IDENT_CURRENT('[tbl_Election]')
      ,[UserID]
      ,[Position]
      ,[Plataforma]
      ,1 FROM @Candidates
END
--------------------------------------------------------------------------------------------------------------------------------------------------------------
IF @Type = 'Update'
BEGIN
	UPDATE [tbl_Election] SET [Title] = @Title
	,[ElectionDate] = @ElectionDate
	,[Remarks] = @Remarks WHERE [ID] = @ID

	DELETE FROM tbl_Candidate WHERE ElectionID = @ID
	INSERT INTO tbl_Candidate (UniqueID,[ElectionID]
      ,[UserID]
      ,[Position]
      ,[Plataforma]
      ,[Active])
	  SELECT NEWID(),@ID
      ,[UserID]
      ,[Position]
      ,[Plataforma]
      ,1 FROM @Candidates
END
--------------------------------------------------------------------------------------------------------------------------------------------------------------
IF @Type = 'Search'
BEGIN
	SELECT * FROM [tbl_Election] WHERE Active = 1
END
--------------------------------------------------------------------------------------------------------------------------------------------------------------
IF @Type = 'Election'
BEGIN
	SELECT TOP 1 * FROM [tbl_Election]
	WHERE Active = 1 AND @User NOT IN (SELECT UserID FROM tbl_UnverifiedVote) AND @User NOT IN (SELECT UserID FROM tbl_Vote)
	ORDER BY ID DESC
END
--------------------------------------------------------------------------------------------------------------------------------------------------------------
IF @Type = 'ElectionSummary'
BEGIN
	SELECT * FROM vw_Candidate WHERE ElectionID = (SELECT TOP 1 ID FROM tbl_Election ORDER BY ID DESC)
END
--------------------------------------------------------------------------------------------------------------------------------------------------------------
IF @Type = 'MyVote'
BEGIN
	SELECT TOP 1 * FROM [tbl_Election]
	WHERE Active = 1
	ORDER BY ID DESC
END
--------------------------------------------------------------------------------------------------------------------------------------------------------------
IF @Type = 'Vote'
BEGIN
	INSERT INTO tbl_UnverifiedVote (ElectionID, UserID, Candidate)
	SELECT Election, UserID, Candidate FROM @Vote
END
--------------------------------------------------------------------------------------------------------------------------------------------------------------
IF @Type = 'VerifyVote'
BEGIN

	IF (SELECT COUNT(*) FROM tbl_UnverifiedVote WHERE UserID = @User) >= 1
	BEGIN
		INSERT INTO tbl_Vote (ElectionID, UserID, Candidate)
		SELECT ElectionID, UserID, Candidate FROM tbl_UnverifiedVote WHERE UserID = @User

		DELETE FROM tbl_UnverifiedVote WHERE UserID = @User
		SELECT CAST(1 AS INT)
	END
	ELSE
	BEGIN
		IF (SELECT COUNT(*) FROM tbl_Vote WHERE UserID = @User) >= 1
		BEGIN
			SELECT CAST(2 AS INT)
		END
		ELSE
		BEGIN
			SELECT CAST(3 AS INT)
		END
	END
END
--------------------------------------------------------------------------------------------------------------------------------------------------------------
IF @Type = 'Find'
BEGIN
	SELECT * FROM [tbl_Election] WHERE  ID = @ID
END
--------------------------------------------------------------------------------------------------------------------------------------------------------------

END



