CREATE PROCEDURE [dbo].[tbl_User_Proc]
@Type VARCHAR(50),
@Search VARCHAR(max) = null,
@ID int = null,
@Username varchar(5000) = null,
@Password varchar(5000) = null,
@Role int = null,
@Active bit = null,
@Fingerprint1 varchar(max) = null,
@StudentID varchar(5000) = null,
@fname varchar(5000) = null,
@mn varchar(5000) = null,
@lname varchar(5000) = null,
@Img varbinary(max) = null,
@Gender varchar(5000) = null,
@bday datetime = null,
@Course int = null,
@Timestamp datetime = null
AS
BEGIN
IF @Type = 'Create'
BEGIN
	IF (SELECT COUNT(*) FROM tbl_User WHERE Username = @Username) >= 1
	BEGIN
		SELECT CONVERT(BIT, 0) Result
	END
	ELSE
	BEGIN
		INSERT INTO [tbl_User]
		([Username],[Password],[Role],[StudentID],[fname],[mn],[lname],[Gender],[bday],[Course])
		VALUES
		(@Username,@Password, 2,@StudentID,@fname,@mn,@lname,@Gender,@bday,@Course)
		SELECT CONVERT(BIT, 1) Result
	END
END
--------------------------------------------------------------------------------------------------------------------------------------------------------------
IF @Type = 'Update'
BEGIN
UPDATE [tbl_User] SET [Password] = @Password
,[StudentID] = @StudentID
,[fname] = @fname
,[mn] = @mn
,[lname] = @lname
,[Img] = CASE WHEN @Img IS NOT NULL THEN @Img ELSE Img END
,[Role] = CASE WHEN @Role IS NOT NULL THEN CASE WHEN @Role = 0 THEN [Role] ELSE @Role END ELSE [ROLE] END
,[Gender] = @Gender
,[bday] = @bday
,[Course] = @Course WHERE [ID] = @ID
END
--------------------------------------------------------------------------------------------------------------------------------------------------------------
IF @Type = 'UpdateUserBiometric'
BEGIN
UPDATE [tbl_User] SET Fingerprint1 = @Fingerprint1
WHERE [ID] = @ID
END
--------------------------------------------------------------------------------------------------------------------------------------------------------------
IF @Type = 'Search'
BEGIN
SELECT * FROM [vw_User] 
END
--------------------------------------------------------------------------------------------------------------------------------------------------------------
IF @Type = 'Find'
BEGIN
	SELECT * FROM [vw_User] WHERE  ID = @ID
END
--------------------------------------------------------------------------------------------------------------------------------------------------------------
IF @Type = 'Find_Username'
BEGIN
	SELECT * FROM [vw_User] WHERE  Username = @Username
END
--------------------------------------------------------------------------------------------------------------------------------------------------------------
IF @Type = 'Login'
BEGIN
	SELECT * FROM [vw_User] WHERE HASHBYTES('MD5', Username) = HASHBYTES('MD5', @Username) AND HASHBYTES('MD5', [Password]) = HASHBYTES('MD5', @Password)
END
--------------------------------------------------------------------------------------------------------------------------------------------------------------
END






