CREATE VIEW [dbo].[vw_User]
AS
SELECT u.[ID]
      ,u.[Username]
      ,u.[Password]
      ,u.[Role]
      ,u.[Active]
      ,u.[Fingerprint1]
      ,u.[StudentID]
      ,u.[fname]
      ,u.[mn]
      ,u.[lname]
	  ,Fullname = CONCAT(fname, ' ', mn, ' ', lname)
      ,u.[Img]
      ,u.[Gender]
      ,u.[bday]
	  ,Age = DATEDIFF(YEAR, bday, GETDATE())
      ,u.[Course]
	  ,CourseName = (SELECT Course FROM tbl_Course WHERE ID = u.Course)
      ,[Timestamp]
  FROM [tbl_User] u








