CREATE VIEW [dbo].[vw_Candidate]
AS
SELECT c.[ID]
	  ,c.UniqueID
      ,c.[ElectionID]
      ,c.[UserID]
	  ,Fullname = u.Fullname
	  ,Img = u.Img
	  ,Course = u.CourseName
      ,c.[Position]
	  ,PositionName = (SELECT Position FROM tbl_Position WHERE ID = C.Position)
      ,c.[Plataforma]
	  ,VoteCount = (SELECT COUNT(*) FROM tbl_Vote v WHERE Candidate = c.UniqueID AND v.ElectionID = c.ElectionID)
      ,c.[Active]
      ,c.[Timestamp]
  FROM [tbl_Candidate] c WITH (NOLOCK)
  OUTER APPLY (SELECT * FROM vw_User WHERE ID = C.UserID) u





